            id: "birth-of-the-cool",
            title: "Birth of the cool",
            line1: "BIRTH",
            line2: "OF THE",
            line3: " COOL",
            mention1: "For me, music and life",
            mention2: "...are all about style. - M.D",
            date: 1957,
            label: "CAPITOL",
            producer: "WALTER RIVERS & PETE RUGOLO",
            description: "Even if this album was released in 1957,  <i class='font-italic'>Birth of the Cool</i> is one of the first albums recorded by Miles Davis. Originally, it was recorded in 1949, 8 years before its release. In the late 40s, Miles Davis was already a famous trumpet player of the bebop period. He really launched his trumpetist career by joining the band of <a data-id='bird' href='https://en.wikipedia.org/wiki/Charlie_Parker' target='_blank'>Charlie Bird Parker</a> (one of the greatest bebop soloist ever) in 1945. The collaboration only lasted for a few years (Mostly because the band leader Bird was a drug addict) and in 1948, Miles Davis, in collaboration with the great pianist and composer <a data-id='gil' href='https://en.wikipedia.org/wiki/Gil_Evans' target='_blank'>Gil Evans</a>, decided to distance himself from the principles of bebop which, even if it was fashionable at the time, was more and more judged way too complex. Together, Davis and Evans started to work on a new type of jazz which was to be known as the Cool Jazz, and <i class='font-italic'>Birth of the Cool</i> was, indeed, a cornerstone record of this period. The record was innovative in many ways: in addition to being a new step in jazz music, Miles decided to work with quite an unconventional band : a nonet. As its name suggests, this album was mostly slow.  The recording process lasted 15 months in total. Among the twelve songs recorded, only 6 were released at first. Unfortunately It was a commercial failure at the beginning. The transition from bebop to Cool Jazz was hard to make, and people didnt understand this new style of jazz. Miles waited 8 years to eventually see his work published as one album : <i class='font-italic'>Birth of the Cool</i>.",
            description2: "<i class='font-italic'>Birth of the Cool</i> contains 12 songs in total. The first release contained 11, and a twelfth song (Darn That Dream) was added in 1972. Some of them are re-interpretations of jazz standards, like Moon dreams, which was originally a 1942 song from <a data-id='chummy' href='https://en.wikipedia.org/wiki/Chummy_MacGregor' target='_blank'>Chummy MacGregor</a> and <a data-id='mercer' href='https://en.wikipedia.org/wiki/Johnny_Mercer' target='_blank'>Johnny Mercer</a>. Its a short songs record, all trakcs are more or less 3 minutes long.  The songs were recorded in 3 sessions in total, in January 1949, April 1949 and March 1950). The album was characterized by a use of paired instrumentation: trumpet and alto saxophone, trombone and French horn Even if its purpose was to take a new step in jazz, some tracks undeniably show a bebop influence.",
            description3: "As the first stone record of the cool jazz era, <i class='font-italic'>Birth of the Cool</i> inspired many musicians, even decades after its release. Many of the nonet members like <a data-id='gerry' href='https://en.wikipedia.org/wiki/Gerry_Mulligan' target='_blank'>Gerry Mulligan</a> or <a data-id='lewis' href='https://en.wikipedia.org/wiki/John_Lewis_(pianist)' target='_blank'>John Lewis</a> made successful careers. <i class='font-italic'>Birth of the Cool</i> was inducted into the <a data-id='grammy' href='https://www.grammy.com/grammys/awards/hall-of-fame' target='_blank'>Grammy Hall of Fame</a> in 1982.  In 1998, Capitol released a Complete Edition, that included live sessions recorded in September 1948. In 2019, the documentary filmmaker <a data-id='stanley' href='https://en.wikipedia.org/wiki/Stanley_Nelson_Jr.' target='_blank'>Stanley Nelson Jr.</a> chose the name of this album as a title of a biopic documentary he directed about  Miles Davis.",
