            mention1: "Sometimes you have to play a long time",
            mention2: "...to be able to play like yourself. - M.D",
            date: 1958,
            label: "COLUMBIA RECORDS",
            producer: "GEORGE AVAKIAN",
            description: "The late 50s were the first years of what was to be called the modal jazz and <i class='font-italic'>Milestones</i> is Miles Daviss first album during this musical period. After his bebop, Cool and Hard bop periods, Miles was aspiring to  more simplicity in his compositions. The works and publications of composer <a data-id='russell' href='https://en.wikipedia.org/wiki/George_Russell_(composer)' target='_blank'>George Russell</a> around the modal approach were a turning point in Miless work. In essence, modal jazz makes use of musical modes often modulating between them instead of relying on one tonal center. For the recording of <i class='font-italic'>Milestones</i>, Miles Davis invited famous saxophone player <a data-id='cannonball' href='https://fr.wikipedia.org/wiki/Julian_Cannonball_Adderley' target='_blank'>Julian Cannonball Adderley</a> to join his band alongside tenor saxophone <a data-id='coltrane' href='https://en.wikipedia.org/wiki/John_Coltrane' target='_blank'>John Coltrane</a>. More than a simple play on words, <i class='font-italic'>Milestones</i> is definitely a key step, not only in Miles Daviss musical carreer, but in jazz in general. For him, this first modal record opened the path to famous creations, including <i class='font-italic'>Kind of Blue</i>, maybe the most successful jazz album of all times.",
            description2: "The original album is composed of 6 songs, that last between 5 and 13 min. The inclusion of Julian Adderley as alto sax created a lovable chemistry between what Miles called a blues voice and Coltranes free and harmonious style. The main track was originally titled Miles, and was renamed Milestones later. On this album, Miles also had to play the piano part on one of the tracks, Sids ahead. This was the result of a slight altercation between him and the pianist <a data-id='red' href='https://en.wikipedia.org/wiki/Red_Garland' target='_blank'>Red Garland</a>, who was tired of Miless direction on his work. Most of the tracks are cover versions of famous jazz Standards (Straight, No Chasers, originally from <a data-id='monk' href='https://en.wikipedia.org/wiki/Thelonious_Monk' target='_blank'>Thelonious Monk</a>, Two Bass Hit from <a data-id='lewis' href='https://en.wikipedia.org/wiki/John_Lewis_(pianist)' target='_blank'>John Lewis</a> & <a data-id='dizzy' href='https://en.wikipedia.org/wiki/Dizzy_Gillespie' target='_blank'>Dizzy Gillespie</a>)",
            description3: "Since it represents Miles Daviss first steps into modal jazz, some critics often talk about <i class='font-italic'>Milestones</i> as a premice work that led to Daviss greatest jazz album <i class='font-italic'>Kind of Blue</i> (which he recorded a year after). <i class='font-italic'>Milestones</i> is also the only record of that specific sextet, since Red Garland and Philly Joe Jones left the band after the recording. Yet, this short-lived band was granted with a Grammy Hall Of fame Award in 2004. In 2009, Columbia released a new edition of the record that  included 3 alternate takes.",
