            id: "in-a-silent-way",
            title: "In a silent way",
            line1: "IN A",
            line2: "SILENT",
            line3: "  WAY",
            mention1: "Always look ahead",
            mention2: "... but never look back. -MD",
            date: 1969,
            label: "COLUMBIA RECORDS",
            producer: "TEO MACERO",
            description: "Between 1963 and 1968, Miles was performing with his second greatest quintet, which was fully composed of players younger than him, who became famous in the jazz scene (<a data-id='herbie' href='https://en.wikipedia.org/wiki/Herbie_Hancock' target='_blank'>Herbie Hancock</a>, <a data-id='ron' href='https://en.wikipedia.org/wiki/Ron_Carter' target='_blank'>Ron Carter</a>, <a data-id='wayne' href='https://en.wikipedia.org/wiki/Wayne_Shorter' target='_blank'>Wayne Shorter</a> & <a data-id='williams' href='https://en.wikipedia.org/wiki/Tony_Williams_(drummer)' target='_blank'>Tony Williams</a>). It is with this quintet that he started working with an all new composant : electricity. The last two albums recorded by the band, <i class='font-italic'>Miles in the Sky</i>, and <i class='font-italic'>Filles de Kilimanjaro</i> were the first ones to include electric piano and guitar. Miles was, at that point, very interested by the new possibilities given by those kind of instruments. Especially the sound modulations that electric devices could bring into the musical creation. His meeting with his second wife and musical muse, the singer <a href='https://en.wikipedia.org/wiki/Betty_Davis' target='_blank'>Betty Davis</a> was also an incredible influence in this electric path. She introduced him to the sound of rock legends like <a data-id='hendrix' href='https://en.wikipedia.org/wiki/Jimi_Hendrix' target='_blank'>Jimi Hendrix</a>. In that period, Miles Davis experienced a real change, both in his lifestyle and his music. Dropping his fancy italian suits for a younger, rock style, Miles also evolved slowly but surely towards a new musical style, Jazz-fusion, a mix-up of Jazz and rock music, popularized in the mid-60s with bands like <a data-id='freespirits' href='https://en.wikipedia.org/wiki/The_Free_Spirits' target='_blank'>The Free Spirits</a> or <a data-id='lloyd' href='https://en.wikipedia.org/wiki/Charles_Lloyd_(jazz_musician)' target='_blank'>Charles Lloyd Quartert</a>. It is in that new musical era that he gave birth to his first jazz-rock album, <i class='font-italic'>In A Silent Way</i>. Miles recorded it with a band composed of both old and new players (including guitarist <a data-id='mclaughlin' href='https://en.wikipedia.org/wiki/John_McLaughlin_(musician)' target='_blank'>John Mc Laughlin</a> and piano player <a data-id='zawinul' href='https://en.wikipedia.org/wiki/Joe_Zawinul' target='_blank'>Joe Zawinul</a>). 10 years after the successful <i class='font-italic'>Kind of Blue</i>, Miles Davis was making a musical bold move again, choosing to leave his good old jazz security blanket to embrace something new, wild and audacious. As a fusion result, <i class='font-italic'>In A Silent Way</i> was neither Jazz nor Rock. But if it got a controversial reception from critics who didnt understand it at first, it is still considered as one of Miles Daviss most influential albums ever.",
            description2: "One session. That is all it took to record all the material of <i class='font-italic'>In A Silent Way</i>. One single session of 3 hours on February 18, 1969. The original album is composed of only two long mixed tracks (approximately 20 mins each). The electric instruments give the album a kind of elusive reach, the trumpets leader surfing over electric guitar and piano in a bewitching way. A recording tale says that for the main notes of the first track, John Mc Laughlin was experiencing difficulties satisfying Miles Davis. In the end, the leader gave him a simple and strange instruction : Why dont you play it like you never played guitar?. As a result, John obtained a kind of slow, hesitant, shy and ethereal guitar sound that made the track unforgettable.",
            description3: "As a piooner album, the electric sound and quite unexpected structure of <i class='font-italic'>In A Silent Way</i> provoked divided reactions among jazz critics. As some of Miles fellows players of that time used to say: Its neither jazz nor rock, then it shouldnt be criticized as one or the other. But today, it is clearly considered as one of Miles Daviss biggest musical achievement. In 2001, an anthology was released by Legacy Records, called <i class='font-italic'>In A Silent Way - The complete sessions</i> with both the all tracks of the unique recording session, and some taken from previous electric albums. <i class='font-italic'>In A Silent Way</i> got Miles in the path of Jazz Rock, and led him to the album known as <i class='font-italic'>Bi***es Brew</i>, a psychedelic, tortuous and haunting production, and his second biggest commercial success (with <i class='font-italic'>Kind of Blue</i>).",
